def create_histogram(pix):
   pixels = []
   for i in range(0, pix.shape[0]):
      for c in range(0, pix.shape[1]):
         pixels.append(pix[i][c][0])
   labels, values = zip(*Counter(pixels).items())
   indexes = np.arange(len(labels))
   plt.bar(indexes, values, 1)
   plt.xticks(indexes + 1 * 0.5, labels)
   plt.show()
   
